import React from "react";
import './bodySkills.css';

class ProgressBar extends React.Component {
    render() {
        return(
            <div>

            <h4 className="progress-bar-label">{this.props.title}</h4>
            <div className="progress-bar">
                <div className="progress">{this.props.level}</div>
            </div>
            </div>
        )

    }
 }


class bodySkills extends React.Component {
    render() {
        return (
            <div className={this.props.className}>
               <h1 className="skills-header">Professional Skills</h1>
                <div className="container-splitter">
                    <div className="col-container">
                    <ProgressBar title="HTML" level="Basic" percent=""/>
                    <ProgressBar title="CSS" level="Basic" percent=""/>
                    <ProgressBar title="JavaScript" level="Basic" percent=""/>
                    </div>

                    <div className="col-container">
                    <ProgressBar/>
                    <ProgressBar/>
                    <ProgressBar/>
                    </div>
                </div>
                
            </div>
        )


    }

}
 export default bodySkills;
